Na religião egípcia, o deus Hórus é visto como o deus do céu, do sol nascente e mediador dos mundos. Filho dos deuses Ísis e Osíris, representa a luz, a realeza e o poder.                                                                                                                  

• Harendotes (“Hórus, o salvador do seu pai”);
• Harmachis (“Hórus do horizonte”);
• Haroeris (“Hórus, filho de Ré”);
• Harpócrates (“Hórus menino”);
• Harsiese (“Horus, filho de Isis”);
• Harsomtus (“Hórus, o unificador”);
• Horematawy (“Hórus, unificador das duas terras”).                                                                                          

A depender do lugar de adoração, é representado por corpo de homem e cabeça de falcão. Também surge com asas de gavião, um disco solar sob a cabeça e na mão esquerda uma chave – controle da vida e da morte.

